from collections import deque
from typing import List



class NumberOfIncreasingPathsInAGrid:
    def countPaths(self, grid: List[List[int]]) -> int:
        MOD = 1_000_000_007
        R=len(grid)
        C=len(grid[0])

        result=0

        dp={}

        for r in range(R):
            for c in range(C):
                result = (result + self.dfs(grid, R, C, r, c, dp)) %MOD
        return result

    def dfs(self, grid, R, C, r, c, dp):
        MOD = 1_000_000_007
        if (r, c) in dp:
            return dp[(r, c)]

        nei=[(r+1, c), (r-1, c), (r, c+1), (r, c-1)]

        res=1
        for nr, nc in nei:
            if -1<nr<R and -1<nc<C and grid[nr][nc]>grid[r][c] :
                res= (res +self.dfs(grid, R, C, nr, nc, dp)) % MOD

        dp[(r,c)]=res
        return res




